import React from 'react';
import CharacterList from './components/CharacterList';

interface AppProps {
  characters: {
    name: string;
    relatedCharacters: string[];
    events: string[];
    funFacts: string[];
  }[];
}

const App: React.FC<AppProps> = ({ characters }) => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Iliad Wiki</h1>
      </header>
      <main>
        <CharacterList characters={characters} />
      </main>
    </div>
  );
};

export default App;
